import "./App.scss";
import axios from 'axios'
import SearchBar from "./components/Search/Search";

class App extends React.Component {
  onSearchSubmit(term) {
    axios.get('https://api.unsplash.com/search/photos', {
     params: { query: term },
     headers: {
      Authorization: 'Client-ID dBpXovVafx_tZ-cN-SFPF_ji8UBkqGu-x9MHO_x1-y8'
     }
    })
  }
  render() {
    return (
      <div>
        <SearchBar></SearchBar>
      </div>
    )
  }
}

export default App;
